import React from 'react';
import {Route, Routes } from "react-router-dom";
import Homepage from "./Home";
import Cart from "./Cart";
import Product from "./Product";
import About from "./About";
import Faq from "./Faq";
import Logincontainer from "./Logincontainer";
import RegisterSeller from './Registerseller';
import ProductDisplay from './Productdisplay';
import Logout from './Logout';
import Yorders from './Yorders';
import Privaterouteseller from './Privaterouteseller';
import RegisterProduct from './Registerproduct';
import Recievedorders from './Recievedorders';
import Privateroutecustomer from './Privateroutecustomer';
import Singleorder from './Singleorder';
import Pendingorders from './Pendingorders';
import NotFound from './NotFound';
const Mainrouter = () => {
    return (
        <Routes>
            <Route path="/" exact component={<Homepage/>}/>
            <Route path="/about" component={<About/>}/>
            <Privateroutecustomer path="/cart"  component={<Cart/>}/>
            <Route path="/product/:type/:page"  component={<Product/>}/>
            <Route path="/faq"  component={<Faq/>}/>
            <Route path="/login" component={<Logincontainer/>}/>
            <Route path="/logout" component={<Logout/>}/>
            <Route path="/registerseller" component={<RegisterSeller/>}/>
            <Route path="/yorders/:id" component={<Privateroutecustomer><Singleorder/></Privateroutecustomer>}/>
            <Route path="/yorders" component={<Privateroutecustomer><Yorders/></Privateroutecustomer>}/>
            <Route path="/recievedorders"  component={<Privaterouteseller><Recievedorders/></Privaterouteseller>}/>
            <Route path="/insertproduct"  component={<Privaterouteseller><RegisterProduct/></Privaterouteseller>}/>
            <Route path="/pendingorders"  component={<Privaterouteseller><Pendingorders/></Privaterouteseller>}/>
            <Route path="/productdisplay/:productId" component={<Privaterouteseller><ProductDisplay/></Privaterouteseller>}/>
            <Route path='*' component={<NotFound/>}/>
        </Routes>
    );
}

export default Mainrouter
